import { HeaderActionTypes } from './header.types';

export const toggleModal = () => ({
  type: HeaderActionTypes.TOGGLE_MODAL,
});



export const changeModalType = (type) => ({
  type: HeaderActionTypes.CHANGE_MODAL_TYPE,
  payload: type,
});
